import { Button } from "react-bootstrap";
import { useNavigate } from "react-router";
import React from "react";

function homeButton() {
    const navigate = useNavigate();
    return (
    <Button
    onClick={() => navigate("/")}>
        Home
    </Button>
    )
}

export default homeButton;
